import React, {useState} from 'react';
import PropTypes from 'prop-types';
import AppBar from '@material-ui/core/AppBar';
import CssBaseline from '@material-ui/core/CssBaseline';
import Divider from '@material-ui/core/Divider';
import Drawer from '@material-ui/core/Drawer';
import Hidden from '@material-ui/core/Hidden';
import IconButton from '@material-ui/core/IconButton';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import MailIcon from '@material-ui/icons/Mail';
import MenuIcon from '@material-ui/icons/Menu';
import Toolbar from '@material-ui/core/Toolbar';
import { createTheme } from '@material-ui/core/styles';
import { makeStyles, useTheme } from '@material-ui/core/styles';


import {useHistory} from 'react-router-dom'
import logo from '../icons/black_logo.png';
import facebook from '../icons/facebook.svg';
import instagram from '../icons/instagram.svg';
import linkedin from '../icons/linkedin.svg';
import twitter from '../icons/twitter.svg';

import Button from '@material-ui/core/Button';
import styles from '../css/Header.module.css'




  



function Header(props){
    const history = useHistory()
    
    const [isOpen, setisOpen] = useState(false);
    
    const { window } = props;
  
    const theme = createTheme({
        palette: {
          primary: {
            main: "#ffffff",
          },breakpoints: {
            values: {
              xs: 0,
              sm: 650,
              md: 960,
              lg: 1280,
              xl: 1920,
            }},

         
        },
      });

      const drawerWidth = 240;



const useStyles = theme => ({
  root: {
      [theme.breakpoints.up('sm')] : {
    display: 'none',
    height:"100px",
    backgroundColor: theme.palette.secondary.main
  },
  },
  drawer: {
    [theme.breakpoints.up('sm')]: {
      width: drawerWidth,
      flexShrink: 0,
      
    },
  },
  appBar: {
    [theme.breakpoints.up('sm')]: {
      width: `calc(100% - ${drawerWidth}px)`,
      marginLeft: drawerWidth,
      backgroundColor: theme.palette.secondary.main
    },
  },
  menuButton: {
    marginRight: theme.spacing(2),
    [theme.breakpoints.up('sm')]: {
      display: 'none',
    },
  },
  // necessary for content to be below app bar
  toolbar: theme.mixins.toolbar,
  drawerPaper: {
    width: drawerWidth,
  },
  content: {
    flexGrow: 1,
    padding: theme.spacing(3),
  },
  button : {
    backgroundColor: 'white',
    outline:'none',
    boxShadow: ' none',
    border: '1px solid grey',
    
    
    '&:hover':{
        background:'none',
        boxShadow:'none',
    }

},
});


const classes = useStyles();
  const [mobileOpen, setMobileOpen] = React.useState(false);

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const drawer = (
    <div>
      <div className={classes.toolbar} />
      <Divider />
      <List>
        {['Home', 'About', 'ContactUs'].map((text, index) => (
          <ListItem button key={text}>
            <ListItemText primary={text} />
          </ListItem>
        ))}
      </List>
      <Divider />
      <List>
        {['All mail', 'Trash', 'Spam'].map((text, index) => (
          <ListItem button key={text}>
            <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon>
           
          </ListItem>
        ))}
      </List>
    </div>
  );

    const container = window !== undefined ? () => window().document.body : undefined;
    
    return(
      <>
      <ThemeProvider theme = {useStyles}>
      <div className={classes.root}>
      <CssBaseline />
      <AppBar position="fixed" className={classes.appBar}>
        <Toolbar>
          <IconButton
            color="inherit"
            aria-label="open drawer"
            edge="start"
            onClick={handleDrawerToggle}
            className={classes.menuButton}
          >
            <MenuIcon />
          </IconButton>
         
        </Toolbar>
      </AppBar>
      <nav className={classes.drawer} aria-label="mailbox folders">
        {/* The implementation can be swapped with js to avoid SEO duplication of links. */}
        <Hidden smUp implementation="css">
          <Drawer
            container={container}
            variant="temporary"
            anchor={theme.direction === 'rtl' ? 'right' : 'left'}
            open={mobileOpen}
            onClose={handleDrawerToggle}
            classes={{
              paper: classes.drawerPaper,
            }}
            ModalProps={{
              keepMounted: true, // Better open performance on mobile.
            }}
          >
            {drawer}
          </Drawer>
        </Hidden>
        <Hidden xsDown implementation="css">
          <Drawer
            classes={{
              paper: classes.drawerPaper,
            }}
            variant="permanent"
            open
          >
            {drawer}
          </Drawer>
        </Hidden>
      </nav>
      
    </div> 
    </ThemeProvider> 
    <header className = {styles.header}>
    <img className = "logo" src= {logo} alt = "a" style = {{margin:"0 5%",padding:"5px 0"}}></img>
    
    <nav> 
        
        <ul className = {styles.headerlist}>
             <li onClick = {() => history.push('/')}><a href = "" className = {styles.headerlinks}> Home </a> </li> 
            <li className = {styles.links}> <a href = "" className = {styles.headerlinks} > About </a></li>
            <li > <a href = "#featured" className = {styles.headerlinks} style = {{display:"none"}}> Featured  </a></li>
            <li > <a href = "#contact-us" className = {styles.headerlinks}>Contact Us </a></li>
            <li> </li>

        </ul>
        
        <div className = "social">
            <div>
                <i><Button variant= "contained" className = {classes.button}><a href= "tel:+92-331-4900" style = {{textDecoration:"none",color:"black"}}>+92 331 409 3900</a></Button></i>
            </div>
            <div style ={{display:"flex",justifyContent: "flex-start", padding:"5px 0" }}>
                <i style = {{padding: "0 5px"}} ><a href = "http://fb.com/surePropertiesPakistan"><img src = {facebook} alt = "facebook" style = {{width:"15px",height:"15px"}}></img></a></i>
                <i style = {{padding: "0 5px"}}><a  href = "https://www.instagram.com/surepropertiespk/"><img src = {instagram} alt = "instagram" style = {{width:"15px",height:"15px"}}></img></a></i>
                <i style = {{padding: "0 5px"}}><a href = "https://www.linkedin.com/company/sureproperties/"><img src = {linkedin} alt = "linkedin" style = {{width:"15px",height:"15px"}}></img></a></i>
                <i style = {{padding: "0 5px"}}><a href = "https://twitter.com/PropertiesSure"><img src = {twitter} alt = "twitter" style = {{width:"15px",height:"15px"}}></img></a></i>
            </div>
        
        </div>
    </nav>
    
   <div  className = "checked" >
    <div className = "hamburger" ></div>
    </div>
    
    
</header> 
</>
)
}

